import React from "react"
import { Link } from "react-router-dom"

const Navbar = () => {
    return (
        <Navbar>
                <Link to="Homepage">Homepage</Link>
                <Link to="About">About Me</Link>
                <Link to="Register">Register</Link>
        </Navbar>
    )
};

export default Navbar
